var express = require('express');
var cors = require('cors');

var app = express();
const port = 8088;

var corsOptions = {
    origin: process.env.NODE_ENV == "test" ? '*' : 'https://analysis-photo.com',
    credentials: true
}
app.use(cors(corsOptions));
app.use(express.json({
    limit: '1mb'
}));
app.use(express.urlencoded({extended:false}));

app.post('/generate', async (req, res) => {
    var body = req.body;
    res.end();
    resultSave(body.userImgBase64, body.partyNum, body.props, body.fileUID);
});

app.listen(port, () => {
    console.log(`Generator is running on ${port}`);
})